import React from "react";
import {Grid, Text, Button} from "../elements";
import {getCookie, deleteCookie} from '../shared/Cookie';
import Permit from "../shared/Permit";

import {useSelector, useDispatch} from "react-redux";
import {actionCreators as userActions} from "../redux/modules/user";

import {history} from "../redux/configureStore";
import {apiKey} from "../shared/firebase";

const Header = (props) => {
    const dispatch = useDispatch();
    const is_login = useSelector((state) => state.user.is_login);

    const _session_key = `firebase:authUser:${apiKey}:[DEFAULT]`;

    const is_session = sessionStorage.getItem(_session_key)
        ? true
        : false;

    console.log(is_session);

    // if(is_login && is_session){     return (     ) } <Button text="매거진"
    // onClick={() => {     history.push('/post'); }}></Button> 코드
    if(is_login && is_session) {
        return (
            <Permit>
                <React.Fragment>
                    <Grid is_flex="is_flex" padding="4px 16px">
                        <Grid>
                            <Button text="메인"
                        _onClick={() => {
                            history.push('/postlist'); }}> </Button>
                        </Grid>

                        <Grid is_flex="is_flex">
                            <Button text="내정보"></Button>
                            <Button text="알림"></Button>
                            <Button
                                text="로그아웃"
                                _onClick={() => {
                                    dispatch(userActions.logoutFB());
                                }}></Button>
                        </Grid>
                    </Grid>
                </React.Fragment>
            </Permit>
        );
    }
    return (
        <React.Fragment>
            <Grid is_flex="is_flex" padding="4px 16px">
                <Grid>
                <Button text="메인"
                        _onClick={() => {
                            history.push('/'); }}> </Button>
                </Grid>

                <Grid is_flex="is_flex">
                    <Button
                        text="로그인"
                        _onClick={() => {
                            history.push('/login');
                        }}></Button>
                    <Button
                        text="회원가입"
                        _onClick={() => {
                            history.push('/signup');
                        }}></Button>
                </Grid>
            </Grid>
        </React.Fragment>
    )
}

Header.defaultProps = {}

export default Header;
